import React, { useState, useEffect } from 'react';
import Navbar from '../components/Navbar';
import axios from 'axios';
import logo from '../assets/logo.jpg';
import { debounce } from 'lodash';

const WeeklyProjects = () => {
    const [projects, setProjects] = useState([]);
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);
    const [currentPage, setCurrentPage] = useState(1);
    const [searchTerm, setSearchTerm] = useState('');
    const projectsPerPage = 6;

    useEffect(() => {
        const fetchWeeklyProjects = async () => {
            setLoading(true);
            try {
                const response = await axios.get('https://gessamubackend.onrender.com/projects/getweekly-projects');
                setProjects(response.data);
            } catch (error) {
                setError('Failed to fetch weekly projects.');
            } finally {
                setLoading(false);
            }
        };

        fetchWeeklyProjects();
    }, []);

    const handleSearch = debounce(() => {
        if (searchTerm.trim() === '') {
            setError('Please enter a search term.');
            return;
        }
        setLoading(true);
        try {
            const filteredProjects = projects.filter(project => {
                const title = project.title || '';
                const description = project.description || '';
                const trainer = project.trainer || '';
                return (
                    title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                    description.toLowerCase().includes(searchTerm.toLowerCase()) ||
                    trainer.toLowerCase().includes(searchTerm.toLowerCase())
                );
            });

            if (filteredProjects.length > 0) {
                setProjects(filteredProjects);
            } else {
                setError('No projects found.');
            }
        } catch (error) {
            setError('Failed to fetch search results.');
        } finally {
            setLoading(false);
        }
    }, 500);

    const indexOfLastProject = currentPage * projectsPerPage;
    const indexOfFirstProject = indexOfLastProject - projectsPerPage;
    const currentProjects = projects.slice(indexOfFirstProject, indexOfLastProject);
    const totalPages = Math.ceil(projects.length / projectsPerPage);

    const handlePageChange = (pageNumber) => {
        setCurrentPage(pageNumber);
    };

    return (
        <>
            <Navbar className="z-10" />
            <div className="flex-1 p-6 bg-gray-50 overflow-y-auto h-screen">
                <h1 className="text-3xl font-bold mb-6">Weekly Projects</h1>

                <div className="flex justify-center mb-6">
                    <input
                        type="text"
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                        placeholder="Search projects..."
                        className="border border-gray-300 p-2 rounded-md w-1/2 text-black"
                    />
                    <button
                        onClick={handleSearch}
                        className="bg-blue-500 text-white p-2 ml-2 rounded-md hover:bg-blue-600"
                    >
                        Search
                    </button>
                </div>

                {loading && <div className="text-center">Loading...</div>}

                {!loading && (
                    <div className="mt-4 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-2">
                        {currentProjects.length > 0 ? (
                            currentProjects.map((project, index) => (
                                <div
                                    key={index}
                                    className="mb-2 p-2 border bg-gray-200 border-gray-200 rounded-lg shadow-md"
                                >
                                    <h2 className="text-md font-semibold text-blue-600">
                                        <a href={`/project/${project._id}`} target="_blank" rel="noreferrer" className="hover:underline hover:text-blue-600">
                                            {project.title}
                                        </a>
                                    </h2>
                                    <img
                                        src={logo}
                                        alt={project.task || "Task Image"}
                                        className="mt-2 w-20 h-20 object-cover rounded-sm mb-2"
                                    />
                                    <p className="text-black font-semibold">{project.description}</p>
                                    <p className="text-sm text-black font-bold">Trainer: <span className="text-green-600">{project.trainer}</span></p>
                                    <p className="text-sm text-black font-bold">Date: <span className="text-red-700">{new Date(project?.createdAt).toLocaleDateString()}</span></p>
                                </div>
                            ))
                        ) : (
                            <p className="text-center text-gray-500 mt-8">No projects available at the moment.</p>
                        )}
                    </div>
                )}

                {totalPages > 1 && (
                    <div className="mt-4 flex justify-center">
                        <button
                            onClick={() => handlePageChange(currentPage - 1)}
                            disabled={currentPage === 1}
                            className="bg-gray-300 text-gray-700 p-2 rounded-md mx-2"
                        >
                            Prev
                        </button>
                        <span className="text-gray-700">{currentPage} of {totalPages}</span>
                        <button
                            onClick={() => handlePageChange(currentPage + 1)}
                            disabled={currentPage === totalPages}
                            className="bg-gray-300 text-gray-700 p-2 rounded-md mx-2"
                        >
                            Next
                        </button>
                    </div>
                )}
            </div>
        </>
    );
};

export default WeeklyProjects;
